    [],nt"num_tags": 5,nt"name": "narrative-report-brigantine-national-wildlife-refuge-period-ending-april-30-1962",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Brigantine NWR
    outlines Refuge accomplishments from January through April of 1962. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, rodents, mammals, raptors, reptiles,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments and vegetation control. The public relations section of the
    report describes recreational uses, Refuge visitors, Refuge participation, and safety.
    Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
